import React from "react";
import { Col, Container, Row } from "react-bootstrap";

import "../index.css";
import CanvasJS from "canvasjs";
// var CanvasJSChart = CanvasJSReact.CanvasJSChart;
const db = { bw: [180, 181, 182, 181, 180] };

// array of dict { x: <x>, y: <y> }
function getBWData() {
  return db.bw.map((bw, i) => ({ x: bw, y: i }));
}

class BodyWeightWidget extends React.Component {
  render() {
    const chartConfig = {
      animationEnabled: true,
      exportEnabled: true,
      theme: "light1",
      title: {
        text: "Running Weekly Average Body Weight",
      },
      axisY: {
        title: "RWABW",
        includeZero: false,
        suffix: "#",
      },
      axisX: {
        title: "Day",
        interval: 7,
      },
      data: [
        { type: "line", toolTipContent: "{y}lbs", dataPoints: getBWData() },
      ],
    };
    return (
      <div>
        <Container>
          <Row>
            {/* Text */}
            <Col>
              <h3 className="header_smaller">Body Weight</h3>
              <p>Today:</p>
              <p>Weekly Running Average:</p>
              <hr />
              <p>Currently maintaining weight.</p>
            </Col>
            {/* Graph */}
            <Col></Col>
          </Row>
        </Container>
      </div>
    );
  }
}

export default class Log extends React.Component {
  constructor() {
    super();
    this.state = {};
  }

  componentDidMount() {
    this.setState({});
  }

  render() {
    return (
      <div
        style={{
          textAlign: "center",
          margin: "auto",
          padding: "30px",
        }}
      >
        <h1 className="header">The Dashboard</h1>
        <p className="header_smaller">
          This page is currently under development.
        </p>
        {/* Training Block Container */}
        <Container>
          <Row>
            {/* SBD deltas col */}
            <Col></Col>
            {/* Training Block summary col */}
            <Col></Col>
            {/* Next meet Col */}
            <Col></Col>
          </Row>
        </Container>
        {/* Training Week Container */}
        <Container>
          <Row>
            <Col></Col>
          </Row>
        </Container>

        {/* Body Weight Container */}
        <BodyWeightWidget />
      </div>
    );
  }
}
